import connectDB from "./config/db";
import Auth from "./routes/auth/auth.routes";
const app = express();

connectDB();
app.use(Auth);

const PORT = process.env.PORT | 5000;

app.listen(PORT, () => {
  console.log(`Server started at PORT ${PORT}`);
});

